import React,{Component} from "react";

class Children extends Component {
    constructor(){
        super()
    }
    render(){
        return(
            <div className="div_child"> 
                <div></div>Fisrt Name : {this.props.f_name}
                <div></div>Last Name : {this.props.l_name}
                <div></div>Age : {this.props.age}
                <div></div>date : {this.props.date}
                <div></div>email : {this.props.email}
                <div></div>user_name : {this.props.user_name}
            </div>
        )
    }
}

export default Children;
